import React from "react";
import { useState } from "react";
const DogAgeCalculator = () => {
  const [age, SetAge] = useState("h");

  const dogAge = 0;

  return (
    <>
      <input
        type="number"
        value={age}
        onChange={(e) => SetAge(e.target.value)}
        placeholder="Age"
      />
      <h3>{age * 7}</h3>
    </>
  );
};

export default DogAgeCalculator;
